import React from "react";
import Data from "./Data";

const Card = () => {
  let data = {
    id: 1,
    name: "sourav",
    age: 22,
    state: "odisha",
  };
  return (
    <>
      <div>{data.id}</div>
      <Data/>
    </>
  );
};

export default Card;
